import './App.css';
import 'antd/dist/antd.css';
import { Col, Row } from 'antd';

function App() {
  return (
    <div style={{padding: '0px 10px', backgroundColor: "black", minHeight: '100vh'}}>
      <Row>
        <Col span={24} style={{paddingTop: '30vh'}} align="center">
          <img style={{width: '20%'}} src="https://media0.giphy.com/media/pkFr2QFMLrvwlFgvim/giphy.gif?cid=ecf05e475ihf4hp2x9rdxwn122r6p290w6nbgtffqzsx4hju&rid=giphy.gif&ct=g" alt="a"/>
        </Col>
      </Row>
    </div>
  );
}

export default App;
